import React from "react";
import axios from "axios";

function Task(taskData) {
  return (
    <li key={taskData._id} className="task">
      <div className="task__container">
        <h4 className="task__name">{taskData.name}</h4>
        <h5 className="task__parent-list"></h5>
        <p className="task__date">
          {taskData.date.day}.{taskData.date.month}.{taskData.date.year} {taskData.date.hour}:
          {taskData.date.minute}
        </p>
        <button className="task__important-mark"></button>
      </div>
    </li>
  );
}

export default Task;
